#Harshvatika in Gorakhpur is one of my father's projects. He is a psychiatrist and has his own hospital, since all three kids grew up in different careers and no-one grew up to be....a ...doctor, papa picked up new hobbies to keep himself busy so he started this grand marriage hall as well ...my sister was wed here. Initially I was hesitant to be wed here someday, but when I saw the amount of labour, passion and love that went into making the place and how much it means to pappa and mumma , I decided to someday get married here ! Loooooong shot....I mean...shadi me time hai , but whenever it is, it's going to be here in #gorakpur ! 
